import React from 'react'
import './header.css'
import logo from './Img/onlineshop.png'
const Header=()=>{
    return(
        <div  className="header">
        <img src={logo} alt="title" className="headerImg"/>
        <input type="text" placeholder="asd 12 ASD"/>
        <button>Search</button>
        </div>
    )
}
export default Header
